import CryptoJS from 'crypto-js';
import communes from './communes';
import icones from './icones';

let key = process.env.REACT_APP_KEY;
key  = CryptoJS.enc.Base64.parse(key);

let iv = process.env.REACT_APP_IV;
iv = CryptoJS.enc.Base64.parse(iv);

let encryptedData = null;
let decryptedData = null;

const isNumeric = (str) => {
    if (typeof str != "string")
    {
        return false 
    }
    return !isNaN(str) && !isNaN(parseFloat(str))
}

const encryption = (message) => {
    encryptedData = CryptoJS.AES.encrypt(message, key, {
        iv: iv,
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7
    });
    return encryptedData.toString();
}

const decryption = (message) => {
    decryptedData = CryptoJS.AES.decrypt(message, key, {
        iv: iv,
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7
    });
    let decryptedText = decryptedData.toString(CryptoJS.enc.Latin1);
    return decryptedText;
}

const encryptionUser = (message) => {
    encryptedData = CryptoJS.AES.encrypt(message, key, {
        iv: iv,
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7
    });
    return encryptedData.toString();
}

const decryptionUser = (message) => {
    decryptedData = CryptoJS.AES.decrypt(message, key, {
        iv: iv,
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7
    });
    let decryptedText = decryptedData.toString(CryptoJS.enc.Utf8);
    return decryptedText;
}

const dataUser = () => {
    return JSON.parse(decryptionUser(getLocalStorage("user")))
}

const validateEmail = (email) => {
    var emailformat = String(email).toLowerCase().match(/^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/);
    if (email != null) {
        if (emailformat) {
            return true;
        };
        return false;
    }
    return false;
};


const escapeRegExpMatch = function(s) {
    return s.replace(/[-\/\\^$*+?.()|[\]{}]/g, '\\$&');
};

const isExactMatch = (str, match) => {
  return new RegExp(`\\b${escapeRegExpMatch(match)}\\b`).test(str)
}

const setLocalStorage = (key, value, ttl) => {
    const now = new Date()

    const item = {
        value: value,
        expiry: now.getTime() + ttl,
    }
    localStorage.setItem(key, JSON.stringify(item))
}

const getLocalStorage = (key) => {
    const itemStr = localStorage.getItem(key)

    if (!itemStr) {
        return null
    }

    const item = JSON.parse(itemStr)
    const now = new Date()

    if (now.getTime() > item.expiry) {
        localStorage.removeItem(key)
        return null
    }
    return item.value
}

const reculogo = "data:image/png;base64,"

const methods = {
    isNumeric,
    encryption,
    decryption,
    validateEmail,
    isExactMatch,
    communes,
    icones,
    setLocalStorage,
    getLocalStorage,
    reculogo,
    encryptionUser,
    dataUser,
};

export default methods;